#include <iostream>#include <vector>using namespace std;const vector<int> PATTERN_7 = {0, 2, 4, 1, 5, 3, 6};const vector<int> PATTERN_8 = {0, 2, 4, 1, 5, 7, 3, 6};const vector<int> PATTERN_4 = {1, 3, 0, 2};void solve() {    int n;    if (!(cin >> n)) return;    if (n == 1) { cout << "1\n"; return; }    if (n == 2 || n == 3) { cout << "NO SOLUTION\n"; return; }    int rem = n % 5;    int standard_blocks = n / 5;    if (rem == 2 || rem == 3) {        standard_blocks--;    }    int current = 1;    for (int k = 0; k < standard_blocks; k++) {        cout << current << " " << current + 2 << " " << current + 4 << " "             << current + 1 << " " << current + 3 << " ";        current += 5;    }    int left = n - current + 1;    if (left == 0) {    }    else if (left == 1) {        cout << current;    }    else if (left == 4) {        for (int i = 0; i < 4; i++)            cout << current + PATTERN_4[i] << (i == 3 ? "" : " ");    }    else if (left == 7) {        for (int i = 0; i < 7; i++)            cout << current + PATTERN_7[i] << (i == 6 ? "" : " ");    }    else if (left == 8) {        for (int i = 0; i < 8; i++)            cout << current + PATTERN_8[i] << (i == 7 ? "" : " ");    }    cout << "\n";}int main() {    ios_base::sync_with_stdio(false);    cin.tie(NULL);    solve();    return 0;}